// WORKING WITH BOOLEAN STRUCT ARRAYS

//This returns index 1 of the struct
resultBool := getBool32(bools, 1);

//This will copy over the struct array to another array
//movedBools := bools;
// OR
FOR i:=0 TO 31 DO
	setBool32(movedBools, i, getBool32(bools, i));
END_FOR

//This will initialize/reset/fill the struct array with some values
FOR i:=0 TO 31 DO
	setBool32(initBools, i, TRUE);
END_FOR

//This will copy over the struct array to another array and do some extra logic
FOR i:=0 TO 31 DO
	currentBool := getBool32(bools, i);
	setBool32(invertedBools, i, NOT currentBool);
END_FOR

// WORKING WITH NUMBER STRUCT ARRAYS

//This returns index 1 of the struct
resultNum := getInt32(nums, 1);

//This will copy over the struct array to another array
//movedNums := nums;
// OR
FOR i:=0 TO 31 DO
	setInt32(movedNums, i, getInt32(nums, i));
END_FOR

//This will initialize/reset/fill the struct array with some values
FOR i:=0 TO 31 DO
	setInt32(initNums, i, i);
END_FOR

//This will increment every index by one each cycle
FOR i:=0 TO 31 DO
	currentNum := getInt32(incrementingNums, i);
	setInt32(incrementingNums, i, currentNum + 1);
END_FOR

// WORKING WITH USER DATA TYPE STRUCT ARRAYS

FOR i:=0 TO 31 DO
	//For easier data manipulation, extract current devices commands and status
	//Now the getters must be function blocks as we cannot return as structure in iec
	getCmd(data:=deviceCmds, ix:=i);
	getStatus(data:=deviceStatuses, ix:=i);
	deviceCmd := getCmd.Out;
	deviceStatus := getStatus.Out;

	//If device is running, set the reference to 200
	IF deviceStatus.Running THEN
		deviceCmd.Ref := 200;
	ELSE
		deviceCmd.Ref := 0;
	END_IF

	//Reset device only if it has stopped
	deviceCmd.ResetCmd := deviceStatus.ResetRequired AND NOT deviceStatus.Running;

	//Start/Stop the device by writing to deviceCmds.udt_cmdXX from the init window*)
	deviceCmd.StartCmd := (deviceCmd.StartCmd OR deviceStatus.Running) AND NOT (deviceStatus.ResetRequired OR deviceCmd.StopCmd);

	//Finally write the new command data to the array
	//As we always return TRUE or FALSE we can keep this as a function
	setUDT_Cmd32(deviceCmds, i, deviceCmd);

END_FOR
// Manipulate the deviceStatuses from the init window
